import React from "react";
import { Outlet } from "react-router-dom";
import { Link } from "react-router-dom";

function Pricing() {
  return (
    <div>
      Show Pricing
      <nav>
        <Link></Link>
      </nav>
      <Outlet />
    </div>
  );
}

export default Pricing;
